import '../tours/Tours.css';


function Tours(props) {

    return (
      <div>
        {props.DATA1.map((tour) => (
          <div key={tour.id} className='tour'>
            <h2>{tour.name}</h2>
            <img src={tour.image} alt={tour.name} />
            <button onclick="myFunction()">Learn more</button>

            <p id="demo"></p>

            <p>{tour.info}</p>

          </div>
        ))}
      </div>
    );
  }
  export default Tours;
